import styled from "styled-components";

const ButtonElement = styled.button`

background: none;
	border: none;
	padding: 0;
	font: inherit;
	cursor: pointer;
	outline: inherit;
font-family: 'Inter';
font-style: normal;
font-weight: 400;
font-size: 14px;
line-height: 24px;
color: #2C1674;

`;

export const Button: React.FC<{ onClick: () => void; title: string, }> = ({ onClick, title }) => {
    return (
        <button onClick={onClick}>{title}</button>
    )
}
